INSERT INTO `contenidos_blog` VALUES (1, 'Online Divorce and Pre-Nuptial Agreements', '<p>Online Divorce and premarital agreements are not mutually exclusive. You can file for divorce through an online platform even if you have a premarital agreement. Of course, if neither party intends to contest it.</p>\r\n\r\n<p>What’s in a pre-nuptial agreement? What’s the purpose of it? Is it all about expectation of failure, or does it deal with more positive issues and can it feel good, not bad, to negotiate all the terms and make your decisions together? See the checklist in my book, “Just in Case! Lose your heart, not your mind” for the essential elements of a pre-nuptial agreement.</p>\r\n\r\n<p>A few thoughts on the subject:</p>\r\n\r\n<p>Firstly, give yourself time. I cannot stress this enough. Ideally, you should give yourself 6 months. You should be very conscious of your sense of self and self-protective instincts when you’re working out the details of the agreement. Avoid the pitfall of “over-willingness” – being anxious to sign anything and everything that your partner asks, to “prove” that you’re all about love, not money. And don’t let yourself be shamed or intimidated into leaving out provisions that you know are important, out of a fear of seeming too concerned with money or rights to property down the line. It’s all about fairness, and there’s no fairness if one party’s interests are favored over the other. Know your worth, keep a level head, be practical and truthful, and employ the services of a trusted family law professional to keep the process productive and even-handed.</p>\r\n\r\n<p>Next, find a divorce lawyer. Look for one who has negotiated many pre-nuptial agreements and will make sure that yours covers all the bases, complies with all laws, and will stand up to the test of time. Also, an experienced attorney will know what you should fight over and what is unreasonable. Whomever you find, be sure to check that lawyer’s background and look him/her up on websites that rate law firms and lawyers and provide client testimonials.</p>\r\n\r\n<p>I don’t discount for a minute the difficulty of bringing the subject of these agreements up with your partner in the first place. You might need to get help with just that, to start with. Pre-marital counseling would be a good place to broach the subject or with a trusted and wise friend or family member who can you can consult about not just the need for a pre-nuptial agreement but the best way to bring the subject up with your partner. Think about the initiation of the process very carefully, and lay the groundwork with thought and care before you start.</p>\r\n\r\n<p>Finally, the idea of the prenuptial agreement is that should you end up filing for divorce, the process Is simplified. You can use <a href=\"file:///C:/xampp/htdocs/trabajos/ale_marsico/quick_divorce/___materiales/quickdivorce/get-started.html\">https://thequickdivorce.com/get-started/</a> and engage in an amicable divorce that is efficient and inexpensive.</p>\r\n', '1026772067', 'online-divorce-and-pre-nuptial-agreements', '2022-07-02 13:25:19', '2022-07-02');
INSERT INTO `contenidos_blog` VALUES (2, 'Divorce and Money – Basics of Budgeting', '<p>Know this: Finances are the leading cause of marital troubles. Doesn’t that tell you that finances are one of the most important parts of <em>staying</em> in love – more important, even than fidelity, at least statistically speaking? So be a grownup and do all of your research, and then talk with your spouse or if you’re in the middle of a divorce, you need to do this for yourself.</p>\r\n\r\n<p>Your math skills are as important as your verbal skills here. Go one by one through the items with paper, pencil, and calculator or an excel spreadsheet at hand.</p>\r\n\r\n<p>If you’ve never done a budget before, here’s a quick how-to:</p>\r\n\r\n<p>Make a list of your monthly fixed expenses, and put the dollar amount next to each, like this:</p>\r\n\r\n<h4>Fixed Expenses</h4>\r\n\r\n<ul>\r\n	<li>Rent or mortgage (does mortgage escrow for taxes and insurance)</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Property taxes (if applicable and not included in mortgage payment)</li>\r\n	<li>Property Insurance (if applicable and not included in mortgage payment)</li>\r\n	<li>Utilities (phone, internet, gas, electric, water, sewer, trash service)</li>\r\n	<li>Food & Supplies for the home</li>\r\n	<li>Maid Services</li>\r\n	<li>Lawn & Pool services</li>\r\n	<li>Health Insurance premiums and co-payments</li>\r\n	<li>Car payment(s) or transportation expenses</li>\r\n	<li>Car Insurance</li>\r\n	<li>Car Wash</li>\r\n	<li>Gasoline & Oil</li>\r\n	<li>Parking & Tolls</li>\r\n	<li>Credit card debt payments</li>\r\n	<li>Other loan payments</li>\r\n	<li>Medical expenses</li>\r\n	<li>Taxes (if self-employed)</li>\r\n	<li>Miscellaneous expenses</li>\r\n	<li>Emergency Savings</li>\r\n</ul>\r\n\r\n<p>Now make a list of monthly discretionary expenses, and put what you feel is a reasonable dollar amount next to each:</p>\r\n\r\n<h4>Discretionary Expenses</h4>\r\n\r\n<ul>\r\n	<li>Entertainment (restaurants, theater, sporting events etc.)</li>\r\n	<li>Hobbies & recreation</li>\r\n	<li>Meals outside the home</li>\r\n	<li>Clothing/Shoes/Accessories, etc.</li>\r\n	<li>Grooming</li>\r\n	<li>Gifts to others</li>\r\n	<li>Gifts to your children</li>\r\n	<li>Travel</li>\r\n	<li>Drycleaning</li>\r\n	<li>Non-Prescription medication and vitamins</li>\r\n	<li>Cosmetics and grooming</li>\r\n	<li>Club Dues and memberships</li>\r\n	<li>Education/Professional development expenses</li>\r\n	<li>Religious Donations</li>\r\n	<li>Investment Savings</li>\r\n</ul>\r\n\r\n<p><em>Children expenses</em></p>\r\n\r\n<ul>\r\n	<li>Nursery, Babysitting, Nanny, Daycare</li>\r\n	<li>School Tuition</li>\r\n	<li>School Supplies, books and fees</li>\r\n	<li>Extra Curricular activities</li>\r\n	<li>Lunch Money</li>\r\n	<li>Private Lessons/Tutoring</li>\r\n	<li>Clothing/Uniforms</li>\r\n	<li>Health Insurance</li>\r\n	<li>Medical Expenses</li>\r\n	<li>Grooming</li>\r\n	<li>Summer Camps</li>\r\n	<li>Miscellaneous</li>\r\n</ul>\r\n\r\n<p><em>Payments to Creditors</em></p>\r\n\r\n<ul>\r\n	<li>Credit cards</li>\r\n	<li>Student loans</li>\r\n	<li>Mortgage/HELOC debt</li>\r\n	<li>Unsecured debt</li>\r\n</ul>\r\n\r\n<p><strong>Add up your fixed and discretionary expenses and write down the total.</strong></p>\r\n\r\n<p>Now add up your income:</p>\r\n\r\n<h4>Income</h4>\r\n\r\n<ul>\r\n	<li>Husband NET income (take-home pay)</li>\r\n	<li>Wife NET income (take-home pay)</li>\r\n	<li>Owner draw from a business or K1 income</li>\r\n	<li>Interest income</li>\r\n	<li>Corporate – Dividends or K1 Income</li>\r\n	<li>Stock Investment income</li>\r\n	<li>Trust Income</li>\r\n	<li>Rental income (minus expenses)</li>\r\n	<li>Freelance work</li>\r\n	<li>Income from any other sources</li>\r\n</ul>\r\n\r\n<p><strong>Add up your total income and write down the total.</strong></p>\r\n\r\n<p><strong>Now subtract total expenses from total income</strong>.</p>\r\n\r\n<p>If the result is a positive number, your budget appears to be healthy, assuming that all the numbers you’ve estimated are close to reality. If it’s a negative number, then you need to either increase income or reduce expenses until the final sum comes up as either zero or a positive number. Otherwise, you will be going into debt each and every month and that debt will mount, and guess what – you’ll be in financial trouble. That’s a fact, not something that will take care of itself.</p>\r\n\r\n<p>Here’s where true adult behavior is a must. You must realize that the budget exercise is not a homework assignment that you can do incompletely or poorly; there is no grade of “C” where money is concerned. You can’t add up your numbers, come up in the negative, and throw up your hands and say “I hate money. This doesn’t work. Why even try. Forget it.” Well, actually, to be perfectly accurate, you can, of course, and many do. Those are the folks who end up in financial trouble; they have mounting credit card debt or overdue bills and they’re constantly stressed about money. You can join them if you like.</p>\r\n\r\n<p>But if you want to be free of financial stress and worry, you have to accept that you’re not done with your budget until you get an “A,” a grand sum total of income minus expenses being greater than or equal to zero. If your numbers add up to a negative, you will be in the red. You will. You cannot accept this and figure it will “all work out somehow.” It won’t, I guarantee you.</p>\r\n\r\n<p>You must – I cannot stress this enough – you <em>must</em> keep working with that pad and paper or that excel spreadsheet and adjust those numbers on the budget until you have a healthy and realistic budget. This means you will have to make real-life choices that will change the way you are going to live: choices about the size and location of your home, the amount that you and your spouse will earn, the kinds of cars you will drive (or if you’ll take public transportation to save money), whether you’ll join a health club or choose jogging to stay in shape, and even when or if you will have children. Money affects how you live. How you live affects your money. Make choices that both of you can happily live with and choices that will keep your financial picture healthy.</p>\r\n', '1041073573', 'divorce-and-money-basics-of-budgeting', '2022-07-02 13:21:30', '2022-07-02');
INSERT INTO `contenidos_blog` VALUES (3, 'Tips To Maintain Financial Self-Sufficiency ', '<p><strong>You can lean on someone, but you have to be able to stand on your own two feet, at a moment’s notice.</strong></p>\r\n\r\n<p>Everything is peachy in a marriage, until it isn’t. Women, who earn less than men and especially those who don’t earn at all, are severely disadvantaged during a divorce. I am a divorce attorney so my advice is written from that vantage point but the message applies to all women regardless of the condition of your relationship - it applies to everyone who is not in control of their finances. Ask yourself – can you stand on your own two feet at a moment’s notice? Can you pay your basic expenses if your partner suddenly decides to cut you off? No one wants to think about this but everyone should.</p>\r\n\r\n<p><strong>You cannot live without money and you should not live without knowledge regarding it.</strong></p>\r\n\r\n<p>Money and knowledge together form a powerful vehicle without which your options are severely limited. I don\'t want your options to be limited for lack of knowledge about your finances. When you find yourself in an uncomfortable situation you are considering extricating yourself from, I would like it if finances did not play a role in your decision-making. When you are faced with the incredibly difficult task of creating a chasm in the lives of your children, you should not also have to worry about how you are going to put food on the table or a roof over their head.</p>\r\n\r\n<p><strong>The solution is to trust, but verify the information you have regarding your finances and your livelihood.</strong></p>\r\n\r\n<p>It’s harder to be caught off guard if you always maintain your guard. I am not suggesting that you be paranoid. What I propose is that you keep yourself educated about the institutions where your money is being held, what type of assets you own, how much money you have in your bank accounts, what debts are tied to your name and when you’re asked to sign something – please, goodness’s sake, read it first.</p>\r\n\r\n<p><strong>Always have access to your own separate funds, create your personal emergency fund.</strong></p>\r\n\r\n<p>You should also be saving money in your own separate account that only you have access to so that you don’t find yourself completely broke after you are cut off from the credit cards and locked out of the only bank account you ever had access to – sadly, this is what happens more often than you would believe, even in long term marriages where on the outside it all looked so perfect. It shouldn’t have to be a secret either. If you are not the primary or joint account holder on an account, you can find yourself in dire straits. In any event, a joint account holder can wipe out the account without the knowledge or consent of the other. There is nothing devious about having your own nest egg.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Critical thinking is mandatory.</strong></p>\r\n\r\n<p>My goal is to provoke critical thinking in women, not arguments with your partner. It is very important to note that needing to \"stand on your own two feet\" does not have to be provoked by divorce. Death or disability are more common than you think and so you just have to know how to take care of yourself and your family. I know...adulting sucks, but here we are mothers, wives, children of aging parents, in short, adults who cannot abdicate our role in our family as productive participants just because someone has said \"don\'t worry, I got this for you.\" Trust but verify.</p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Create a budget of your actual expenses and always know your sources of income – again, trust but verify.</strong></p>\r\n\r\n<p>Under any circumstance, it is imperative to know what it costs to run a household and how to access the funds you will need in the short term and then long term to not find yourself in a dire situation. Personal representatives may not always have your best interests in mind. They may be biased toward your partner’s family and then there are the unintentional errors that can cost you a fortune, if only you had been paying attention.</p>\r\n\r\n<p> </p>\r\n\r\n<p><strong>Do your research, be prepared.</strong></p>\r\n\r\n<p>Finally, you need money to hire a lawyer, and no divorce or probate lawyer worth their salt is going to take your case without an upfront retainer paid in full before they start working on your case – even when we know that ultimately your partner will be responsible for a portion, if not all of your fees. Where will you get the money to start your proceedings or defend against them? I hope you don’t need to ever hire a divorce attorney, but it won’t hurt to be prepared to do so, in case you do.</p>\r\n\r\n<p>For more information buy my book: Just in Case!! Lose Your Heart, Not Your Mind - a smart woman\'s guide to marriage and self-sufficiency available on Amazon and Barnes & Nobles.</p>\r\n\r\n<p><a href=\"http://www.aliettehcarolan.com\">www.aliettehcarolan.com</a></p>\r\n\r\n<p><a href=\"http://www.acarolanlaw.com\">www.acarolanlaw.com</a></p>\r\n', '1043668648', 'tips-to-maintain-financial-self-sufficiency', '2022-06-29 20:27:11', '2022-06-29');
INSERT INTO `contenidos_blog` VALUES (4, 'Minimize the Conflict for Your Children’s Wellbeing', '<p>Dealing with the dissolution of your marriage or long term relationship is difficult enough in and of itself, but when there are children involved, it becomes even trickier, as you always want what’s best for your child, and don’t want to cause them any further or unnecessary trauma. It’s extremely important to minimize your child’s exposure to parental discord. It’s best if they don’t witness any extreme conflict between their parents, nor should they be forced to pick sides or become a confidante. The impact on a child’s psyche from such things cannot only be utterly devastating, but can also result in lifelong trauma that affects every future relationship they have as an adult.</p>\r\n\r\n<p>Research shows that children of divorce fare better if their parents limit the conflict associated with the divorce process. Conversely, children who experience high levels of parental conflict before and after the divorce are associated with poorer adjustment. Even if there isn’t a formal/ legal marriage certificate, as long as there are children involved, you and the child’s other parent are always going to be involved in each other’s lives for the sake of your child.</p>\r\n\r\n<p>One way of helping to minimize the inevitable emotional distress for your child is to try and focus on the positive aspects that the impending divorce will result in. For example, when explaining the upcoming divorce to young children, telling them that their parents living in separate households means that they’ll get to celebrate special occasions like birthdays and holidays such as Christmas or Hanukkah twice - once with each parent. It also means that they’ll have two places to call home. For older children, you can explain that this will be a new beginning for both parents, and although it might take some time to adjust, eventually everyone will be much happier, and your child won’t have to deal with their parents being stressed, unhappy or fighting with each other.</p>\r\n\r\n<p>The ability to file for divorce online is another tool that can help alleviate the stress and emotional damage for all involved. Handling a divorce online allows you and your family to focus your time and energy on healing yourselves both mentally and emotionally by greatly decreasing the time you have to spend in an attorney’s office, courtroom or other legal setting.</p>\r\n', '1125091266', 'minimize-the-conflict-for-your-childrens-wellbeing', '2022-10-06 07:17:13', '2022-10-06');
INSERT INTO `contenidos_blog` VALUES (5, 'Grieving the Death of Your Marriage', '<p>Ending a relationship is never easy, and regardless of who decides to end it, there will always be a grieving process for both parties involved. The most important thing you can do for your mental health is to accept this truth and allow yourself the time to grieve. It will take at minimum, 6 months, but it often takes longer, especially if the relationship was a long one. During this time, you want to be sure to be mindful of your sense of self. Not only do you not want to make rash decisions as a result of being angry or hurt, but you also want to avoid being overly anxious to “prove” to your partner that you’re not being vindictive or materialistic.</p>\r\n\r\n<p>Although there is far less stigma attached to divorce now than there was in the past, it’s not at all uncommon for someone going through one to feel isolated and alone. Part of this may well be the result of society not viewing the grieving process during a divorce in the same way they view the grieving process after the death of a friend or loved one. However, let’s take a moment to think about the definition of death. According to Merriam-Webster, one of the definitions is “the passing or destruction of something” and also “a cause of ruin”. What is divorce if not the passing or ending of a marriage? Is it not just as important to grieve for the “death” of your relationship?</p>\r\n\r\n<p>When dealing with the sadness and grief that are an unavoidable part of divorce, it’s imperative to keep in mind that there is no right or wrong way to navigate through the process. What works for some people might not work for others. For some people, throwing a divorce party and burning pictures or their wedding attire helps bring closure. For others, writing a goodbye letter and perhaps expressing the feelings you may not feel comfortable telling your partner face to face is very cathartic. Many people find talking to a therapist to be immensely therapeutic when working through their grief.</p>\r\n\r\n<p>Remember to be gentle with yourself and take things one day at a time. Just as with the grieving process after the death of a friend or loved one, there are stages of grief after a divorce that you’ll need to work through. Many people think they’ve gotten through one stage and moved on to the next only to find themselves backsliding to a previous stage temporarily. This is completely normal and to be expected. Just know that with every day that passes, you are one step closer to processing your grief and sadness, and one step closer to both mental and emotional healing and acceptance.</p>\r\n\r\n<p>Having the ability to <a href=\"https://www.thequickdivorce.com/\">file for divorce online</a> is one way to help alleviate some of the mental and emotional stress that is a part of any marriage ending. Not having to spend your time meeting with attorneys, going to multiple court dates, etcetera allows you to spend your time and energy on your emotional wellbeing and going through the grieving process so you can heal and ultimately move on with your life.</p>\r\n', '1037823564', 'grieving-the-death-of-your-marriage', '2022-10-20 09:38:55', '2022-10-20');
INSERT INTO `contenidos_blog` VALUES (6, 'Hope for the Best. Plan for the Worst!', '<p>The sobering fact is that over 20 percent of marriages end in divorce within the first 5 years, and 48 percent don’t make it to 20 years, with finances being the leading cause of marital troubles. Knowing this fact should tell you how important it is to be knowledgeable about the financial situation in your marriage from the beginning. If financial problems are the leading cause of marital issues, imagine how quickly those issues can develop if one partner has no knowledge of the family’s basic finances, like how much money is being brought in every month, how much is being paid out on bills, housing and other living expenses. Imagine if one partner doesn’t even know how much money is in the bank at any given point in time, and doesn’t have the ability to check. It’s a recipe for disaster.</p>\r\n\r\n<p>If you’re in a marriage and have absolutely no clue about your finances as a couple - or even worse, have no knowledge of your family budget and no ability to access money without having to ask your spouse, should you ever have to make the decision to file for divorce, things could quickly become exceedingly difficult should your spouse refuse to allow you to access money. Additionally, you may well end up being taken advantage of financially during the divorce if your spouse decides to be vindictive and hide assets.</p>\r\n\r\n<p>Regardless of how happy you currently are in your marriage, it’s critical that you take a proactive role in your family finances, such as knowing the family budget, knowing what money is coming in and going out every month, and having access to your own funds. An easy way to do this is by having both a joint checking account with your spouse, as well as you both having a separate checking account that isn’t shared. That way, if things ultimately don’t work out, you won’t be trapped because of a lack of access to money.</p>\r\n\r\n<p>When two people get married, the last thing they want to consider is that their relationship won’t last. Sadly, with over 1 in 4 marriages failing within the first five years, and the high cost associated with hiring a divorce attorney in the United States, being financially prepared just in case the need ever arises is imperative to avoid the unnecessary stress and mental anguish that would otherwise be unavoidable if you have no knowledge of your family’s finances and/or no access to money.</p>\r\n\r\n<p>If both you and your spouse have equal knowledge of your budget and finances and you both have the ability to access cash, the likelihood of having a more amicable and far less stressful divorce goes up significantly. It will also make filing for divorce online easier, which will save you time and money.</p>\r\n\r\n<p>Think of being financially prepared and knowledgeable in your marriage in the same way as you think about hurricane preparedness when you live in Florida. It’s not fun to think about and no one wants to go through it, but being prepared nonetheless will make all the difference should you ever have to.</p>\r\n', '1020634050', 'hope-for-the-best-plan-for-the-worst', '2022-11-02 12:33:52', '2022-11-02');
INSERT INTO `contenidos_blog` VALUES (7, 'A Brief History Of Divorce', '<p>Henry VIII is likely the most well known person in early English history to get a divorce.In fact, it was him wanting to divorce his first wife, Catherine of Aragon, who had been unable to produce a son and heir to the throne for Henry - but being denied by the Catholic Church - that ultimately caused him to break with the Catholic Church and found the Church of England. That was how difficult divorces once were to obtain. Even the King of England was denied, and the result was the creation of what we now refer to as the Protestant branch of Christianity.</p>\r\n\r\n<p>The creation of Protestantism may have facilitated the ability for a couple to divorce without the permission of the Catholic Church, but for the next several hundred years, a divorce could only be obtained by proving that one of the parties was “at fault” for the marriage failing. Even then, only certain egregious acts were considered grounds for divorce. Worse still, the spouse who was seeking the divorce had to not only prove fault, but was also required to prove that they had “clean hands”. In other words, they could not have done anything wrong in the marriage either - even if they were defending themselves, or if their actions were a result of their spouse’s behavior. There were also exceedingly long waiting periods and residency requirements that had to be met before an individual was legally able to request for the dissolution of their marriage.</p>\r\n\r\n<p>Even in the 1900s, there were vastly different residency requirements and waiting periods to contend with depending on which state the person was filing for divorce from. Nevada had the shortest waiting period of any of the US states, so before Las Vegas was even really on the map, and long before it was the tourist mecca that it is today, Reno, Nevada was the place that everyone flocked to … not to simply vacation, but because Reno started marketing itself as the divorce capital of the world. Hotels, casinos, and other entertainment venues were conveniently and strategically built near the courthouse to entice the tourists who had flocked to the state seeking a “quickie” divorce. Many actors, actresseses, musicians and other famous people took advantage of Reno’s quickie divorces in the early to mid 1900s.</p>\r\n\r\n<p>It wasn’t until 1969 that California Governor, Ronald Reagan, attempted to eliminate the deception often used to prove fault when seeking a divorce by signing a law that allowed couples to end their marriage because of irreconcilable differences rather than because one party was “at fault”. Over the next decade, the remaining forty-nine states followed suit. It took several hundred years, but divorce was finally an option for someone seeking to end their marriage without having to go through the church and without having to prove that your spouse was at fault for the marriage failing because they committed one of the few acts deemed severe enough to merit the legal dissolution of your union.</p>\r\n\r\n<p>Now we’ll fast forward to the late 1900s and the early 2000s. This extremely influential time period is when the internet became available to the general population in the United States after going public. It didn’t take very long at all for legal companies to realize that there was both the market and the need for various legal forms to be easily accessible online, such as forms to write a will, create a power of attorney, write a prenuptial agreement, or file for divorce.</p>\r\n\r\n<p>The advancements society has made regarding the divorce process mean that it’s now possible to end your marriage with far less stress, minimal legal appointments and at a fraction of the cost by filing the necessary paperwork online at a reputable legal website, such as <a href=\"https://www.thequickdivorce.com/\">www.TheQuickDivore.com</a>. This allows you to move on with your life much more quickly and focus on the next chapter.</p>\r\n', '1071686681', 'a-brief-history-of-divorce', '2022-11-09 21:14:45', '2022-11-09');
INSERT INTO `contenidos_blog` VALUES (8, 'How long after my divorce should I consider reentering the dating scene?', '<p>There is no magic period of time that a person should wait after a divorce before they begin dating again, as everyone is different. However, generally speaking, one year is usually the period of time one should aim for before they jump back into the dating scene. You want to make sure you’ve had ample time to grieve for and come to terms with your divorce, neither of which can be effectively done if you’re actively navigating through the dating scene.</p>\r\n\r\n<p>You also want to make sure that you’re dating for the right reasons. Dating shouldn’t be a way to distract you from your thoughts and feelings, because you don’t like the idea of being alone, or because you’re craving affection and a self-esteem boost. Additionally, after the end of your marriage, you want to have time to reflect on what about your previous relationship didn’t work, as well as reflecting on if there was anything missing in the relationship that you now realize is important to you in future relationships. Spending time alone to reflect will also help you learn more about yourself - your wants and needs, understanding your reactions to the everyday stressors that are bound to happen in any relationship, as well whether the ways you handle specific situations could be better handled differently.</p>\r\n\r\n<p>When you think about it, being comfortable and happy on your own is absolutely crucial for any long term relationship to last. You have to be able to make yourself happy on your own before anyone else can make you happy. It is much easier to learn about yourself, including your wants and needs in a relationship when you’re alone and not being influenced by or catering to someone else’s wants and needs.</p>\r\n\r\n<p>Once enough time has passed after your divorce that you feel ready to get back into the dating scene, and you know more about what you’re looking for in a partner, as well as qualities you don’t want in a partner, it’s important to take things slowly. You definitely don’t want to dive headlong into a new relationship too quickly. It’s best to take your time and really get to know the person you’re dating. Being slow and deliberate when getting to know someone and opening up to them helps mitigate potential heartache if things don’t work out.</p>\r\n\r\n<p>Ultimately, you want to make your feelings and emotional wellbeing a priority. Don’t make the mistake of ending one bad relationship just to jump headlong into another one. Take the time after the conclusion of your relationship to heal emotionally and reflect on what does and doesn’t work for you in a partner and relationship. Don’t feel pressured or rushed to re-enter the dating scene. The timeline that works for one person may not work for another. The most important thing is to be happy and comfortable with yourself. The rest will fall into place in due course.</p>\r\n', '1034067409', 'how-long-after-my-divorce-should-i-consider-reentering-the-dating-scene', '2022-12-29 18:18:35', '2022-12-29');
INSERT INTO `contenidos_blog` VALUES (9, 'Breaking the News To Your Family and Friends', '<p>So, you’ve made the difficult decision to end your marriage. At some point, it is inevitable that you will need to let your family and friends know about your divorce. Even though it may not be the easiest discussion to have, there are some ways of handling it that might make the conversation a bit easier.</p>\r\n\r\n<p>Obviously, if there are children involved, they should be the first people you break the news to. Ideally, both you and your partner should sit down together with your children to explain what’s happening. Focus on the positive aspects of the divorce, such as less fighting between their parents, the fact that ultimately, their parents will be happier, which will mean the entire family will be happier, etcetera. One very important thing to avoid doing is placing blame on the other parent or putting them down and talking badly about them. Regardless of how angry and upset you are with your soon to be ex, forcing your children to pick sides isn’t fair to them and will ultimately only cause more trauma.</p>\r\n\r\n<p>You and your spouse will also need to share the news with your families. Typically, you would each talk to your own respective families, and whether you choose to do that together or separately is completely up to you. Generally, a brief explanation will suffice for most family members. Saying something to the effect of “after much deliberation, we’ve realized that our marriage is no longer working, so we’ve made the difficult decision to get divorced and go our separate ways. We would appreciate privacy as we navigate through this new chapter in our lives” should be sufficient. Obviously, if there are close family members whom you feel need more of an explanation, then absolutely share as much as you’re comfortable with.</p>\r\n\r\n<p>As it relates to breaking the news to your friends, the same type of short and straightforward approach will also be fine. However, understand that if you and your spouse have mutual friends, then they often feel as though they have to choose sides. Although it may hurt to feel like you’re losing a friend, it’s often only temporary, and once the dust settles you may well find them back in your life. For this reason, you should make every effort to not allow your hurt feelings to cause you to burn bridges with those you care about and consider friends.</p>\r\n\r\n<p>Going through a divorce is a difficult thing for anyone, so the last thing you should have to deal with is heaping on additional stress by feeling like you need to overshare the details of your divorce or answering questions about it that you aren’t comfortable with. If there are details of your divorce that you don’t wish to divulge, then don’t let anyone make you feel pressured to do so. Ultimately, what details you share and how much to elaborate on those details is your decision to make.</p>\r\n\r\n<p>Most importantly during this trying time in your life, remember that your family and friends care about you and are trying to support you in the best way they know how. Divorce isn’t easy for anyone to go through. Keep looking ahead to the future, understanding that it does eventually get easier, and knowing that you are not alone.</p>\r\n', '1008518520', 'breaking-the-news-to-your-family-and-friends', '2023-01-05 08:27:12', '2023-01-05');
INSERT INTO `contenidos_blog` VALUES (10, 'How To Handle The Inevitable Loss Of Friends After A Divorce', '<p>After a divorce, the sad actuality is that some of the friends you have may not stay in your life. For example, if they were friends with your ex before your relationship started, they may feel like they need to remain loyal to them, and thus cut you out of their lives. Fortunately, losing friends because of them feeling like they need to remain loyal to your ex can often just be temporary. As time passes and emotional wounds begin to heal, you may well find some of these people back in your life. This is an example of why it’s important to be mindful regarding your emotions and take care with the things you might say in a moment of hurt or anger that you may not actually mean down the road.</p>\r\n\r\n<p>Unfortunately, it is far more common for women to lose some of their friendships after a divorce than it is for men. There are a few different reasons for this, but they all have one thing in common. What possible reasons are there for women being more prone to losing friends, you ask? Well, one reason is because a newly single female is often perceived as a threat. Being married, a woman is typically considered off limits, but as a single woman, whether founded in reality or not, you may have female friends who may now be worried that you’ll try to take their partner. Another reason that you may find yourself with fewer friends is because people can view divorce as something that’s almost contagious. Perhaps having a friend who’s currently going through or who has just recently gotten divorced causes them to reevaluate their own marriage. If that marriage wasn’t solid to begin with or is going through a rough patch, it may be easier for them to cut you out of their life than to deal with confronting their own marital issues. Finally, a reason for women losing friends is because, as discussed earlier, there is a grieving process when going through a divorce, and many people are simply uncomfortable dealing with grief, whether it be their own, or watching a friend go through it. Therefore, to them, it can be easier to just avoid it. Is this a healthy response? Absolutely not. However, it definitely happens.</p>\r\n\r\n<p>Have you noticed the one thing the three reasons listed above as to why a friend starts ghosting you after a divorce have in common? It’s being afraid. It’s being afraid that a newly single woman is now a threat to them and their relationship. It’s being afraid to analyze their own relationship and marriage for fear that it may also lead to divorce. It’s being afraid to confront their own feelings of sadness and grief or be afraid to support you while you do.</p>\r\n\r\n<p>Understanding the reasons behind women losing more friendships after a divorce may not make it easier to handle at the time, but it should help reassure you that it isn’t your fault if it does happen. A friend’s inability to cope with their own feelings of fear has nothing to do with you and your friendship. It’s something they’ll have to deal with on their own. However unpleasant it is to go through losing a friend at the time, the truth of the matter is that the friendships you may lose as a result of another person being afraid isn’t really a friendship worth keeping. True friends will be there for you no matter what, not just when it’s convenient for them.</p>\r\n\r\n<p>At the end of the day, understand that while divorce isn’t easy, and that it’s possible you will lose some friends as a result of your marriage ending, your happiness in the end is worth it. If there are friends who don’t remain in your life, feeling sadness for such a loss is completely normal and to be expected. Just as you grieved for the loss of your marriage, you will need to go through the grieving process for any friendships that have ended as well. Allow yourself to process these emotions and grieve. It’s important to be kind to yourself. Keep in mind that there’s no right or wrong way to feel about losing a friend. Most importantly, remember that there’s always a light at the end of the tunnel, and choosing to end an unhappy marriage is the first step towards that light.</p>\r\n', '1022338119', 'how-to-handle-the-inevitable-loss-of-friends-after-a-divorce', '2023-01-26 20:07:28', '2023-01-26');
