INSERT INTO `contenidos_disclaimer` VALUES (1, '<p><strong>Copyright 2021 The Quick Divorce, Inc. </strong>© <strong>The Quick Divorce, Inc.</strong>© <strong> provides information, services and software only. The Quick Divorce, Inc.</strong>© <strong> is not a “lawyer referral service”; and cannot and does not provide legal advice or participate in any legal representation. The Quick Divorce, Inc.</strong>© <strong> is not a law firm or a substitute for an attorney or law firm. Use of The Quick Divorce, Inc. </strong>© <strong>is subject to our Terms of Service and Privacy Policy.</strong></p>\r\n\r\n<p>The Quick Divorce, Inc.© is not a law firm and its services, website and forms are not a substitute for the advice of an attorney. Our staff attorneys may from time to time speak with you, but they will not be engaging with you within the context of an attorney-client relationship, therefore, no privilege attaches to your communications and you should not rely on any statement made to you whether oral or written without consulting a licensed attorney in your state.</p>\r\n\r\n<p>The Quick Divorce, Inc.© provides access to computer-aided, self-help services at your specific direction. The terms of your agreement are decided by the user and all language contained in the forms is suggestive only. The language suggested does not constitute legal advice and the forms, paragraphs and terms offered are not exhaustive. You may need to deal with issues in your specific case that are not addressed by the forms provided to you by The Quick Divorce, Inc.© Note that it is your responsibility to include information about your specific income, expenses, support needs, assets, liabilities, parenting plan, timesharing, child support and any and all other issues related to your divorce, separation or custody disputes in your agreement. Purchasing a package and/or completing the forms does not create an attorney-client relationship between you and the attorneys and staff who work at The Quick Divorce, Inc.© or with the law firm that conducts the electronic filing of your paperwork. There are no communications with any attorney or staff member constitute legal advice or create an attorney-client relationship.</p>\r\n\r\n<p>The Quick Divorce, Inc’s © website and written instructions provide general information about the divorce process only; we endeavor to have the most up-to-date forms as possible, but we do not guarantee that the law will not change. We cannot give you any specific legal advice, opinions or recommendations as to your selection or completion of forms or your particular legal rights, remedies or options. If you do not wish to have your matter electronically filed, it is your obligation to notify The Quick Divorce, Inc. © immediately upon the purchase of our services.</p>\r\n\r\n<p>TheQuickDivorce.com© is an online portal and website that provides access to self-guided online forms to be filed in furtherance of your related legal proceedings. The Quick Divorce, Inc.© does not sell blank forms. You may be able to download blank forms from a government website depending on your state. The Quick Divorce, Inc.© relies on the information that you provide and assumes that this information is accurate and has been verified by you prior to providing the completed forms to The Quick Divorce, Inc.© for electronic filing. The Quick Divorce, Inc.© relies on the integrity of its users and the involvement of both parties to the agreement being reached. The Quick Divorce, Inc. © relies on the contact information provided by its users to notify each party to the agreement of the fact of the forms and agreement being completed and submitted to a court of competent jurisdiction to effectuate the legal processes of divorce and/or the establishment of parental rights and all of the ramifications involved therein.</p>\r\n', '2022-01-07');
