INSERT INTO `contenidos_howitworks` VALUES (1, '<p>TheQuickDivorce.com© is a hybrid, online system with a human touch. </p>\r\n\r\n<p>Satisfaction Guaranteed, No Court Visit Required, We Electronically File Your Paperwork!</p>\r\n\r\n<p>Your steps:</p>\r\n\r\n<ol>\r\n	<li>Verify that you qualify.</li>\r\n	<li>Buy your services package</li>\r\n	<li>Answers the questions to create your required forms. </li>\r\n</ol>\r\n\r\n<p>We do the rest.</p>\r\n\r\n<p>We are the only online divorce services company that offers live assistance, if you need it, allows you to customize your forms and electronically files for you.</p>\r\n\r\n<p>Divorce does not have to be complicated.  Take the quick and easy road - use the The Quick Divorce.</p>\r\n\r\n<p>The forms we offer you were created by an award-winning, family law attorney and published book author. These are not the otherwise free forms offered by our competitors.</p>\r\n\r\n<p>If you get stuck, on an issue, use Thequickdivorce.com© affordable <a href=\"https://www.thequickdivorce.com/product/detail/2-hour-mediations\">mediation packages</a> to help you come together on any issue. No minimum number of hours required. </p>\r\n', '2022-01-07');
