INSERT INTO `contenidos_productos` VALUES (1, 'Simple Divorce Package ', '<p>If you are married and don\'t have children in common with your spouse, then you need a Marital Settlement Agreement in order to go your separate ways in a friendly manner. You can deal with alimony, here too.</p>\r\n\r\n<p>As an added bonus, you pay the court fees directly to the system and we partner with our sister-company and law firm to electronically file your case for you, so you don\'t have to. We stay with you until the end.</p>\r\n\r\n<p>Answer the questions in our automated form and sit back and wait for your case to be resolved quickly, efficiently and economically.</p>\r\n\r\n<p>Your package includes all supplemental documents required for filing<br />\r\n(additional filing fee applies*):</p>\r\n\r\n<ul class=\"qualify-items\">\r\n	<li>Marital Settlement Agreement</li>\r\n	<li>Financial Affidavit</li>\r\n	<li>Petition</li>\r\n	<li>Answer</li>\r\n	<li>Final Judgment</li>\r\n	<li>Family Cover Sheet</li>\r\n	<li>Required Information Sheet</li>\r\n	<li>Designation of Emails</li>\r\n	<li>Notice of Related Cases</li>\r\n	<li>Notice of Filing Adminstrative Order</li>\r\n	<li>Notice of Acceptance of Service</li>\r\n	<li>Affidavit of Non-Military Service</li>\r\n</ul>\r\n', 695.00, 'msa', '1009931930', 'alta', '2022-01-06');
INSERT INTO `contenidos_productos` VALUES (2, 'Married with Children Package', '<p>If you are married, maybe you have some asset and/or debts to divide and have children, you need both a Marital Settlement Agreement <u><strong>and</strong></u> a Parenting Plan. You can address alimony and child support here, too.</p>\r\n\r\n<p>As an added bonus, you pay the court fees directly to the system and we partner with our sister-company and law firm to electronically file your case for you, so you don\'t have to. We stay with you until the end.</p>\r\n\r\n<p>Answer the questions in our automated form and sit back and wait for your case to be resolved quickly, efficiently and economically.</p>\r\n\r\n<p>Your package includes all supplemental documents required for filing<br />\r\n(additional filing fee applies*):</p>\r\n\r\n<ul class=\"qualify-items\">\r\n	<li>Marital Settlement Agreement</li>\r\n	<li>Parenting Plan</li>\r\n	<li>Child Support Calculation</li>\r\n	<li>Financial Affidavit</li>\r\n	<li>Petition</li>\r\n	<li>Answer</li>\r\n	<li>Final Judgment</li>\r\n	<li>Family Cover Sheet</li>\r\n	<li>Required Information Sheet</li>\r\n	<li>Designation of Emails</li>\r\n	<li>Notice of Related Cases</li>\r\n	<li>Notice of Filing Adminstrative Order</li>\r\n	<li>Notice of Acceptance of Service</li>\r\n	<li>Affidavit of Non-Military Service</li>\r\n</ul>\r\n', 1250.00, 'msappa', '1038600245', 'alta', '2022-01-06');
INSERT INTO `contenidos_productos` VALUES (3, 'Parenting Plan Package (parents not married)', '<p>If you have children and are not married to the other parent, this is the package for you.</p>\r\n\r\n<p>You need a Parenting Plan that sets a timesharing schedule, parenting rights and child support.</p>\r\n\r\n<p>As an added bonus, you pay the court fees directly to the system and we partner with our sister-company and law firm to electronically file your case for you, so you don\'t have to. We stay with you until the end.</p>\r\n\r\n<p>Answer the questions in our automated form and sit back and wait for your case to be resolved quickly, efficiently and economically.</p>\r\n\r\n<p>Your package includes all supplemental documents required for filing<br />\r\n(additional filing fee applies*):</p>\r\n\r\n<ul class=\"qualify-items\">\r\n	<li>Parenting Plan Agreement (timesharing and parental responsibility)</li>\r\n	<li>Child Support Calculation</li>\r\n	<li>Financial Affidavit</li>\r\n	<li>Petition</li>\r\n	<li>Answer</li>\r\n	<li>Final Judgment</li>\r\n	<li>Family Cover Sheet</li>\r\n	<li>Required Information Sheet</li>\r\n	<li>Designation of Emails</li>\r\n	<li>Notice of Related Cases</li>\r\n	<li>Notice of Filing Adminstrative Order</li>\r\n	<li>Notice of Acceptance of Service</li>\r\n	<li>Affidavit of Non-Military Service</li>\r\n</ul>\r\n', 895.00, 'ppa', '1099825831', 'alta', '2022-01-06');
INSERT INTO `contenidos_productos_variables` VALUES (1, '30-minute Staff Member Conference', '<p>Get live help on the process or a particular form. Ask our highly trained support staff.</p>\r\n\r\n<p>*Staff members are not licensed attorneys and are not able to provide you with legal advice</p>\r\n', 55.00, '30-minute-staff-member-conference', '1115464027', 'alta', '2022-01-20');
INSERT INTO `contenidos_productos_variables` VALUES (2, '1-Hour Mediation', '<p>Stuck on an issue? Don\'t give up!</p>\r\n\r\n<p>Sometimes it takes a third party to give you perspective. If you need help reaching an agreement on a particular issue, our family law mediators can assist you.</p>\r\n\r\n<p>We offer one-hour sessions. Ask about a multi-hour packages and discounts.</p>\r\n', 145.00, '1-hour-mediation', '1045521568', 'alta', '2022-01-20');
INSERT INTO `contenidos_seo` VALUES (301, 'Online divorce filing for uncontested divorces in Florida', '<p>The Quick Divorce provides an easy, low-cost online alternative for amicable, uncontested divorces (with or without children) in Florida. The system produces all necessary documents and automates the court filing procedure.</p>\r\n', '', '', 0, 0, 'home', 'seccion', '1116440894', '2022-08-08');
