INSERT INTO `contenidos_seo` VALUES (568, 'Minimize the Conflict for Your Children?s Wellbeing', '<p>Children shouldn&#39;t witness any extreme conflict between their parents, nor should they be forced to pick sides or become a confidante.</p>\r\n', '', '', 0, 4, 'blog', 'interna', '1125091266', '2022-10-06');
INSERT INTO `contenidos_seo` VALUES (569, 'Grieving the Death of Your Marriage', '<p>What is divorce if not the passing or ending of a marriage? Is it not just as important to grieve for the &ldquo;death&rdquo; of your relationship?</p>\r\n', '', '', 0, 5, 'blog', 'interna', '1037823564', '2022-10-20');
INSERT INTO `contenidos_seo` VALUES (570, 'Financial problems are the leading cause of marital issues. ', '<p>Financial problems are the leading cause of marital issues. Make sure that you have a complete understanding of your family&#39;s budget and finances.</p>\r\n', '', '', 496, 6, 'blog', 'interna', '1020634050', '2022-11-02');
INSERT INTO `contenidos_seo` VALUES (571, 'A Brief History Of Divorce', '<p>The advancements society has made regarding the divorce process mean that it&rsquo;s now possible to end your marriage with far less stress.</p>\r\n', '', '', 499, 7, 'blog', 'interna', '1071686681', '2022-11-09');
INSERT INTO `contenidos_seo` VALUES (572, 'How long after my divorce should I consider reentering the dating', '<p>How long after my divorce should I consider reentering the dating scene? There is no magic period of time that a person should wait after a divorce before they begin dating again, as everyone is different.</p>\r\n', '', '', 502, 8, 'blog', 'interna', '1034067409', '2022-12-29');
INSERT INTO `contenidos_seo` VALUES (573, 'Breaking the News To Your Family and Friends', '<p>At some point, it is inevitable that you will need to let your family and friends know about your divorce.</p>\r\n', '', '', 504, 9, 'blog', 'interna', '1008518520', '2023-01-05');
INSERT INTO `contenidos_seo` VALUES (574, 'How To Handle The Inevitable Loss Of Friends After A Divorce', '<p><meta charset=\"utf-8\" /><b id=\"docs-internal-guid-4718705d-7fff-d084-6927-d58a18e6ba7f\">Some of the friends you have may not stay in your life.</b></p>\r\n', '', '', 506, 10, 'blog', 'interna', '1022338119', '2023-01-26');
INSERT INTO `contenidos_termsandconditions` VALUES (1, '<h1>Please read these terms and conditions carefully before using this website</h1>\r\n\r\n<p>With Each visit to the <strong>The Quick Divorce, Inc.</strong>© (\"TQD\", \"TheQuickDivorce.com\", \"Company\", \"Website”, or \"Site\") website, or any related tools, scripts, forms, wizards, applications or plug-ins, you signify your agreement to these Terms and Conditions.</p>\r\n\r\n<p><strong>General</strong><br />\r\nIn these Terms and Conditions, the words \"you\" and \"your\" refer to each website visitor, platform customer, or Application user. \"We\", \"us\" and \"our\" refer to TheQuickDivorce.com and \"Services\" refers to all services provided by us. It is your responsibility to review these Terms and Conditions periodically. If at any time you find these Terms and Conditions unacceptable, or if you do not agree to these Terms and Conditions, please do not use this Site or any related platform applications. We may revise these Terms and Conditions at any time without any notice to you. If you have any questions about these Terms and Conditions, please contact us <a href=\"mailto:info@thequickdivorce.com\" target=\"_blank\">here</a>.</p>\r\n\r\n<p>TheQuickDivorce.com© is an online portal and website that provides access to self-guided online forms to be filed in furtherance of your related legal proceedings.</p>\r\n\r\n<p>You confirm that by using the site, any platform applications, and related services that you are at least 18 years of age, that you have carefully read the Legal Disclaimer, and that you are legally able to enter into a contract in the State of Florida.</p>\r\n\r\n<p>These Terms were last modified on August 25, 2022.</p>\r\n\r\n<p>If you do not wish to be bound by these Terms, you are not granted authority to use or access the Site.</p>\r\n\r\n<p>You agree not to use any TQD Material or TQD Services for any purpose which is against any law in your jurisdiction or for any purpose which wou