INSERT INTO `contenidos_whyus` VALUES (1, '<p>Satisfaction Guaranteed, No Court Visit Required, We Electronically File Your Paperwork!</p>\r\n\r\n<p>The Quick Divorce, Inc.© is the only hybrid online solution with a human touch.</p>\r\n\r\n<p>Our founder, Aliette Hernandez Carolan, Esq. has been practicing exclusively in the area of Marital & Family Law since 2004. She recognized that not everyone she wanted to help could afford her services through her traditional law firm model so she created The Quick Divorce, Inc.© to bring her high-end legal services to the public with a quick, efficient and very affordable solution.</p>\r\n\r\n<p>Ms. Carolan divorced in 2016 and has two daughters.  Avoiding chaos and conflict with her spouse was her number one priority in order to ensure a smooth transition for her children. Her philosophy is that resolving divorce and parenting issues amicably is not only possible it should be the only way. </p>\r\n\r\n<p>Ms. Carolan’s personal passion for redefining the divorce process is evidenced not only by the quality of the innovative solution she created, but most significantly by her commitment to roll up her sleeves and share her knowledge through her writing, speaking engagements, media coverage, and social media channels.  Her Amazon Best Selling book <em>Just in Case! Lose Your Heart, Not Your Mind - a smart woman\'s guide to marriage and self-sufficiency</em> was published in New York in 2017.  </p>\r\n', '2022-01-07');
